      stroke: 'red', left: 100, top: 100
    }));
    canvas5.add(new fabric.Polyline(points, {
      stroke: 'green', left: 50, top: 50
    }));
    canvas5.add(new fabric.Polyline(points, {
      stroke: 'blue', left: 150, top: 150
    }));
  })();

